import {Link}  from 'react-router-dom';
import { useState } from 'react';
import Logout from './logout';

const Reviewheader = () =>{
 

    let[isHidden, setIsHidden] = useState(true);
    return(
        <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
          <div className="container-fluid">
         <span className="navbar-brand mb-0 h1">Feedback Portal</span>
           {/* hide the button onclick */}
           <div className="btn btn-group">
          <Link to="/Addfeedback" > {isHidden && <button className="btn btn-danger rounded" type="submit" onClick={() => setIsHidden(false)}>Add Feedback</button>} </Link>
            <Link to="/Logout" ><button className="btn btn-warning" > Welcome - {localStorage.getItem("fullname") } Logout <i className="fa fa-power-off"></i>  </button> </Link>
          </div>
      </div>
       </nav>
    
    )
}
export default Reviewheader;
